import React from 'react';
import Logo1 from '../Images/mylogo.png';

const Header = () => {
	return (
		<div className='header'>
			<div className='logo'>
        <img src={Logo1} alt='logo'/> 
				<h2 className='color2'></h2>
			</div>
		</div>
	);
};
export default Header;
